        <>
                <div className="col-12">
                            <form action="">
                                <InputStyle type="text" placeholder="Search..." name="search"/>
                                <ImageStyle src={require('../../../images/Search.svg')} alt="search"/>
                              </form>
                </div>
        </>
    )
}
